import {
  ChakraProvider,
} from '@chakra-ui/react'

import { Card } from './components/Card';
import { Layout } from './components/Layout';
import { useState } from 'react'

function App() {
  const [value, setValue] = useState(0)
  console.log(value)
  return (
    <ChakraProvider>
      <Layout>
        <Card />
        <div>
          <button onClick={() => setValue(value + 1)}>
            Add
          </button>
          <h1>{value}</h1>
        </div>
      </Layout>
    </ChakraProvider>

  );
}

export default App;
